import 'react-native-url-polyfill/auto'
import AsyncStorage from '@react-native-async-storage/async-storage'
import { createClient } from '@supabase/supabase-js'

const supabaseUrl = 'https://oqutslwpenipplsmjlhm.supabase.co'
const supabaseAnonKey = 'eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpc3MiOiJzdXBhYmFzZSIsInJlZiI6Im9xdXRzbHdwZW5pcHBsc21qbGhtIiwicm9sZSI6ImFub24iLCJpYXQiOjE3MDk3NTk5NjUsImV4cCI6MjAyNTMzNTk2NX0.g9vvjBvpwPutJAbozMcihzVpkx9qeghldSTxGKvX3ok'

export const supabase = createClient(supabaseUrl, supabaseAnonKey, {
  auth: {
    storage: AsyncStorage,
    autoRefreshToken: true,
    persistSession: true,
    detectSessionInUrl: false,
  },
})
